import React from "react";
import { useState } from "react";
import "./index.css"

const App = () =>{

    const [Count, setCount] = useState(0)

    const incNum = () =>{
        setCount(Count + 1)
    }
  return(
      <div className="heading">
          <h1>{Count}</h1>
          <button onClick={incNum}>Click Me</button>
      </div>
  )
}
export default App;
